#include "func.h"
//quicksort 的变型问题
//思路1 二分查找+partition
//中位数 n/2必然是属于出现次数超过一半的数字
int partitionArray(vector<int>& nums,int low,int high){
    int tmp=low;
    int pivot=nums[low];
    while(low<high){
        while(low<high&&nums[high]>=pivot) --high;
        while(low<high&&nums[low]<=pivot)  ++low;
        std::swap(nums[low],nums[high]);
    }
    std::swap(nums[low],nums[tmp]);
    return low;
}
int majorityElement(vector<int>& nums){
    int length=nums.size();
    //二分查找 每次分冶后位置是否等于n/2
    int middle = length/2;
    int low=0;
    int high=length-1;
    int index = partitionArray(nums,low,high);      //分冶后其元素最终位置
    while(index!=middle){               //middle不会变化 直到相等break
        if(index>middle){
            high = index-1;
            index= partitionArray(nums,low,high);
        }
        else{
            low=index+1;
            index= partitionArray(nums,low,high);
        }
    }
    return nums[middle];                //中位数middle位置元素已被确定
}


//思路2 不改变原有数组顺序
//思想:遍历每一个元素，如果和result值相同则计数++.否则--。如果计数==0 更新result
int majorityElement_2(vector<int>& nums)
{
    int result=0;
    int counts=0;
    for(int i:nums){
        if(counts==0){           //result出现次数被抵消为0 则A[i]新元素作为result
            result=i;
            counts=1;
        }
        else if(i==result)
            counts++;           //将result出现次数++
        else
            counts--;           //当前元素和result不同
    }
    return result;
}

